import React from 'react';

const Home = () => {
  const styles = {
    container: {
      textAlign: 'center',
      padding: '10px',
      backgroundColor: '#f0f2f5',
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'flex-start', // Changed from 'center' to 'flex-start'
      alignItems: 'center',
      paddingTop: '0px', // Added padding at the top
    },
    heading: {
      fontSize: '2rem',
      color: '#333',
      marginBottom: '10px',
    },
    imageContainer: {
      marginBottom: '80px', // Increased margin bottom for more spacing below the image
    },
    image: {
      width: '70%',
      maxWidth: '70%',
      height: 'auto',
      borderRadius: '10px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
  };
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Welcome to the Home Page</h1>
      <div style={styles.imageContainer}>
        <img src="/tfp.png" alt="Example" style={styles.image} />
      </div>
    </div>
  );
};

export default Home;
